window.bookSummaryJSON = "<p>Twenty years before Serpint brought Queen Corla home to Harem Station, she met Crux for the very first time. They were destined to be soul mates but could never be together. All they had was just one night.</p> <p>This is the story of Crux and Corla and how all the outlaw brothers came to reside on Harem Station. Meant to be listened to after <i>Booty Hunter</i> and before <i>Big Dicker</i>, it contains a star-crossed love story and secrets that are as deep and dark as space itself.</p> <p>KC Cross is the sci-fi romance pen name of <i>New York Times</i> best-selling author, JA Huss.</p>"; 
